import React from 'react'

export const SeccionUno = (props) => {
    const {setseccion, seccion} = props
    const handleOnClick = () => {
        setseccion(seccion+1)
    }
    return (
        <div className="row">
            <div className="col-12 form-floating mb-3">
                <input type="checkbox" className= "form-check-input" id = "padre_con_vida" value="" /> 
                <label className= "form-check-label" for= "padre_con_vida">Padre vivo</label>

            </div>
            <div className= "col-12 d-flex justify-content-end">
                <button type="button" className= "btn btn-primary" onClick={handleOnClick} >Siguiente</button>
            </div>

        </div>
    )
}
